    false,nt"url": null,nt"notes": "Each summer from 1977 through 1980, the
    Special Studies section of the U.S. Fish and Wildlife Service conducted investigations
    of bird populations and habitat used by waterbirds in the large lake reg1.me north
    and east of Teshekpuk Lake, Naval Petroleum Reserve-Alaska (NPR-A) (Derksen et al.
    1979; Taylor et al.1980). During the 1980 field season, emphasis in the investigation
    shifted from systematic gathering of data on all bird species to concentrated studies
    of black brant (Branta bernicla nigricans) and oldsquaw ducks (Clangula hyemalis).",nt"license_title":
